export const FIND_JOKES_BY_KEYWORD = "FIND_JOKES_BY_KEYWORD";
export const findJokesByKeyword = (jokes) => ({
    type: FIND_JOKES_BY_KEYWORD,
    jokes: jokes
});

export const FIND_JOKE = "FIND_JOKE_BY_ID";
export const findJoke = (jokeId) => ({
    type: FIND_JOKE,
    jokeId: jokeId
});
